        <div class=""temp"">
            <h2 class=""tw-text-2xl tw-font-medium"">What is cryptocurrency market cap?</h2>
            <p>
            Market cap is one of the most popular metrics in the industry that is used to gauge the value of an asset. The market cap of a cryptocurrency is calculated based on the coin's total circulating supply multiplied by the current price. For detailed examples on how the market capitalization of a coin is calculated, please view our <a href=""/en/methodology"">methodology</a> page.
            </p>
            <h2 class=""tw-text-2xl tw-font-medium"">How can I use market cap?</h2>
            <p>As a financial metric, market cap allows you to compare the total circulating value of one cryptocurrency with another. Large cap cryptocurrencies such as Bitcoin and Ethereum have a market cap of over $10 billion. They typically consi");
            WriteLiteral(@"st of protocols that have demonstrated track record, and have a vibrant ecosystem of developers maintaining and enhancing the protocol, as well as building new projects on top of them. From a trading perspective, large caps would typically be hosted on more exchanges, have higher liquidity, and are less volatile when compared against other mid and small cap cryptocurrencies.</p> <p>While market cap is a simple and intuitive comparison metric, it is not a perfect point of comparison. Some cryptocurrency projects may appear to have inflated market cap through price swings and the tokenomics of their supply. As such, it is best to use this metric as a reference alongside other metrics such as trading volume, liquidity, fully diluted valuation, and fundamentals during your research process.</p>
            <h2 class=""tw-text-2xl tw-font-medium"">Is it possible to check crypto prices on mobile?</h2>
            <p>
            Yes, you can check crypto prices on mobile by using the CoinGecko app on <a href=""http");
            WriteLiteral(@"s://gcko.io/coingecko-ios"">iOS</a> and <a href=""https://gcko.io/coingecko-android"">Android</a>.
            </p>
            <h2 class=""tw-text-2xl tw-font-medium"">What are candlesticks in crypto charts?</h2>
            <p>
            Candlestick charts give an overview to traders on the price movement based on previous trends. The body of the candlestick shows where the price of a coin opened and closed for the particular period of time which the candlestick represents. If the candle is green in a crypto chart, it represents positive changes in price while red candle represents negative changes in price. The shadow indicates the high price and low price for the period.
            </p>
